#Retained #AnjuGurung #FairBreakInvitional2023

The 2023 edition of the FairBreak Invitational Tournament is scheduled to be held in Hong Kong from April 1 to 16, 2023. Miss Anju Gurung from Bhutan has been retained for the tournament.
